import './home.css';

const Projects=()=>{
    return (
        <>
         <div className="portfolio-image-container col-6 mx-auto">
					<img src="https://ninjasfiles.s3.amazonaws.com/asset_0000000000000024_1550237299_codezen.png" alt=""/>
					<p className="portfolio-inside-text"><a href="#">CRUD ToDo List</a></p>
				</div>
        </>
    )
}

export default Projects;
